import React,{useState} from 'react';
import "../Button.css";
import Commencer from '../Commencer';
import '../../App.css';
import Com from '../Com';
import { makeStyles } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
  titre:{
    textAlign:"center",
    backgroundColor:"#391465"
  }
}));


export default function Home() {
  const [openCom,setOpencom] =useState(false);
  const classes = useStyles();


  return (<>
  <div className="home">
    <></>

      <div className="commencer">
        <p>Apprendre en<br></br>s'amusant</p><br></br>
        <button onClick={() => { setOpencom(true);}} className="btn">Commencer</button>
        </div>
      </div>    
        <Commencer title="Qui es-tu ?" style={{borderRadius:"50px",boxShadow:"5px 10px 8px 10px #888888"}} openCom={openCom} setOpencom={setOpencom}>
            <Com/>
        </Commencer>
      </>

  );
}
